import React, { useState } from 'react';
import Chat from './Chat';
import './app.css';

const MoodMate = () => {
  const [activeTab, setActiveTab] = useState('chat');
  const [user] = useState({
    username: 'arn@20071'
  });

  return (
    <div className="app-container">
      {/* Header */}
      <header className="app-header">
        <div className="header-left">
          <h1>MoodMate</h1>
          <div className="nav-tabs">
            <button 
              className={activeTab === 'chat' ? 'nav-tab active' : 'nav-tab'}
              onClick={() => setActiveTab('chat')}
            >
              üí¨ Chat
            </button>
            <button 
              className={activeTab === 'ai-coach' ? 'nav-tab active' : 'nav-tab'}
              onClick={() => setActiveTab('ai-coach')}
            >
              ü§ñ AI Coach
            </button>
            <button 
              className={activeTab === 'therapy' ? 'nav-tab active' : 'nav-tab'}
              onClick={() => setActiveTab('therapy')}
            >
              üë®‚Äç‚öïÔ∏è Therapy
            </button>
            <button 
              className={activeTab === 'community' ? 'nav-tab active' : 'nav-tab'}
              onClick={() => setActiveTab('community')}
            >
              üåç Community
            </button>
            <button 
              className={activeTab === 'report' ? 'nav-tab active' : 'nav-tab'}
              onClick={() => setActiveTab('report')}
            >
              üìä Report
            </button>
            <button 
              className={activeTab === 'profile' ? 'nav-tab active' : 'nav-tab'}
              onClick={() => setActiveTab('profile')}
            >
              üë§ Profile
            </button>
          </div>
        </div>
        <div className="header-right">
          <div className="user-info">
            <span className="username">{user.username}</span>
            <button className="logout-btn">Logout</button>
          </div>
        </div>
      </header>

      {/* Main Content */}
      <main className="app-main">
        {activeTab === 'chat' && <Chat user={user} />}
        {activeTab === 'ai-coach' && (
          <div className="tab-content">
            <h2>AI Coach</h2>
            <p>AI Coach features coming soon...</p>
          </div>
        )}
        {activeTab === 'therapy' && (
          <div className="tab-content">
            <h2>Therapy</h2>
            <p>Therapy features coming soon...</p>
          </div>
        )}
        {activeTab === 'community' && (
          <div className="tab-content">
            <h2>Community</h2>
            <p>Community features coming soon...</p>
          </div>
        )}
        {activeTab === 'report' && (
          <div className="tab-content">
            <h2>Reports</h2>
            <p>Report features coming soon...</p>
          </div>
        )}
        {activeTab === 'profile' && (
          <div className="tab-content">
            <h2>Profile</h2>
            <p>Profile features coming soon...</p>
          </div>
        )}
      </main>
    </div>
  );
};

export default MoodMate;
